import React, { Component } from 'react';
import Navigation from './components/Navigation/Navigation';
import Logo from './components/Logo/Logo';
import Rank from './components/Rank/Rank';
import ImageLinkForm from './components/ImageLinkForm/ImageLinkForm';
import Particles from 'react-particles-js';
import './App.css';

const particlesOptions = {
  "fps_limit": 28,
  "particles": {
      "number": {
          "value": 100
      },
      "size": {
          "value": 3
      }
  },
  "interactivity": {
      "events": {
          "onhover": {
              "enable": true,
              "mode": "repulse"
          }
      }
  }

}

const newOptions = {
  "fps_limit": 28,
  "particles": {
      "number": {
          "value": 200,
          "density": {
              "enable": false
          }
      },
      "line_linked": {
          "enable": true,
          "distance": 30,
          "opacity": 0.4
      },
      "move": {
          "speed": 1
      },
      "opacity": {
          "anim": {
              "enable": true,
              "opacity_min": 0.05,
              "speed": 2,
              "sync": false
          },
          "value": 0.4
      }
  },
  "polygon": {
      "enable": true,
      "scale": 0.5,
      "type": "inline",
      "move": {
          "radius": 10
      },
      "url": "/small-deer.2a0425af.svg",
      "inline": {
          "arrangement": "equidistant"
      },
      "draw": {
          "enable": true,
          "stroke": {
              "color": "rgba(255, 255, 255, .2)"
          }
      }
  },
  "retina_detect": false,
  "interactivity": {
      "events": {
          "onhover": {
              "enable": true,
              "mode": "bubble"
          }
      },
      "modes": {
          "bubble": {
              "size": 6,
              "distance": 40
          }
      }
  }
}

function App() {
  return (
    <div className="App">
     <Particles className='particles'
    params={newOptions} />
      <Navigation />
      <Logo />
      <Rank />
      <ImageLinkForm />
      {/* 

      <FaceRecognition /> */}
    </div>
  );
}

export default App;
